import React, { useState, useEffect } from "react";
import axios from "axios";


const Home = () => {

  const [breweries, setBreweries] = useState([]);
  useEffect(() => {
    axios
      .get(`https://api.openbrewerydb.org/breweries/`)
      .then(res => {
        setBreweries(res.data)
      })
      .catch(error => {
        console.log("data not returned", error);
      });
  }, []);

  return (
    <div>
      <h1></h1>
    </div>
  );
};
export default Home;
